      amount={Expense[2].amount}>
        </ExpenseItem> 
        
        <ExpenseItem
       date={Expense[3].date}
      title={Expense[3].title}
      amount={Expense[3].amount}>
        </ExpenseItem> 
        


      </div>
    );
}

export default App;
